func DarwinSudo(cmd string, opt ...SudoOption) error {
	config := NewDefaultSudoConfig()
	for _, p := range opt {
		p(config)
	}
	return DarwinSudoRaw(config.Ctx, config.Verbose, config.Workdir, config.Environments, cmd, config.Stdout, config.Stderr, config.ExitCodeHandler)
}

func DarwinSudoRaw(
	ctx context.Context,
	verbose string,
	cwd string,
	env map[string]string,
	command string,
	stdout, stderr io.Writer, statusCode func(int),
) error {
	switch runtime.GOOS {
	case "darwin":
		if ctx == nil {
			ctx = context.Background()
		}
	default:
		return utils.Error("darwin sudo only works in MacOS")
	}

	tempDir := os.TempDir()
	uid := uuid.NewV4().String()
	tempSudoAppDir := filepath.Join(tempDir, "macos-sudo-"+uid, "sudo.App")
	err := ziputil.DeCompressFromRaw(_darwinSudoAppBytes, tempSudoAppDir)
	if err != nil {
		return utils.Errorf("unzip darwin sudo.App failed: %s", err)
	}
	defer func() {
		os.RemoveAll(tempSudoAppDir)
	}()

	ctx, cancel := context.WithCancel(ctx)
	defer cancel()

	defaultsPath, err := exec.LookPath("defaults")
	if err != nil {
		return utils.Error("cannot find macOS's `defaults` binary")
	}
	infoPlistPath := filepath.Join(tempSudoAppDir, "Contents", "Info.plist")
	outputsRaw, err := exec.CommandContext(ctx, defaultsPath, "write", infoPlistPath, "CFBundleName", strconv.Quote(verbose)).CombinedOutput()
	if err != nil {
		fmt.Println(string(outputsRaw))
		return utils.Errorf("/bin/sh/defaults generating Info.plist failed: %s", err)
	}
	var scripts []string

	if !filepath.IsAbs(cwd) && cwd != "" {
		afterCwd, err := filepath.Abs(cwd)
		if err != nil {
			return utils.Error("cwd to " + cwd + "failed: " + err.Error())
		}
		cwd = afterCwd
	}
	if cwd != "" {
		scripts = append(scripts, "cd "+fmt.Sprintf(`'%v'`, strings.Trim(strconv.Quote(cwd), `"`)))
	}

	if env != nil && len(env) > 0 {
		for k, v := range env {
			if !utils.MatchAllOfRegexp(k, `\w[\w\d]+`) {
				log.Errorf("invalid env key: %v   value: %v", k, v)
				continue
			}
			scripts = append(scripts, fmt.Sprintf(`export %v="%v"`, k, strings.Trim(strconv.Quote(v), `"`)))
		}
	}
	scripts = append(scripts, "")
	scripts = append(scripts, command)
	scripts = append(scripts, "")
	scriptName := filepath.Join(tempSudoAppDir, "Contents", "MacOS", "sudo-prompt-command")
	_ = os.RemoveAll(scriptName)
	err = ioutil.WriteFile(scriptName, []byte(strings.Join(scripts, "\n")), 0766)
	if err != nil {
		return utils.Errorf("write sudo-prompt-command failed: %s", err)
	}
	appletPath := filepath.Join(tempSudoAppDir, "Contents", "MacOS", "applet")
	startupScript := filepath.Join(tempSudoAppDir, "Contents", "MacOS", "sudo-prompt-script")
	err = os.Chmod(appletPath, 0711)
	if err != nil {
		return utils.Error("chmod for applet failed: " + err.Error())
	}
	err = os.Chmod(startupScript, 0711)
	if err != nil {
		return utils.Error("chmod for applet startup script failed: " + err.Error())
	}
	appletCWD := filepath.Dir(scriptName)
	appletCmd := exec.CommandContext(ctx, appletPath)
	appletCmd.Dir = appletCWD
	appletCmd.Stdout = ioutil.Discard
	appletCmd.Stderr = ioutil.Discard
	stdoutPath := filepath.Join(appletCWD, "stdout")
	stderrPath := filepath.Join(appletCWD, "stderr")
	exitCodePath := filepath.Join(appletCWD, "code")
	wg := new(sync.WaitGroup)
	wg.Add(2)
	go func() {
		defer func() {
			wg.Done()
		}()

		if stdout == nil {
			return
		}
		t, err := tail.TailFile(stdoutPath, tail.Config{
			Follow: true,
		})
		if err != nil {
			return
		}
		for {
			select {
			case <-ctx.Done():
				return
			case l, ok := <-t.Lines:
				if !ok {
					return
				}
				if l.Text != "" {
					stdout.Write([]byte(l.Text))
					stderr.Write([]byte{'\n'})
				}
			}
		}
	}()

	go func() {
		defer func() {
			wg.Done()
		}()

		if stderr == nil {
			return
		}
		t, err := tail.TailFile(stderrPath, tail.Config{
			Follow: true,
		})
		if err != nil {
			return
		}
		for {
			select {
			case <-ctx.Done():
				return
			case l, ok := <-t.Lines:
				if !ok {
					return
				}
				if l.Text != "" {
					stderr.Write([]byte(l.Text))
					stderr.Write([]byte{'\n'})
				}
			}
		}
	}()
	_ = appletCmd.Run()
	cancel()
	wg.Wait()
	if statusCode == nil {
		return nil
	}
	raw, _ := ioutil.ReadFile(exitCodePath)
	if raw != nil {
		i, _ := strconv.Atoi(string(raw))
		statusCode(i)
		return nil
	} else {
		statusCode(0)
	}
	return nil
}
